      const callingElevator = (e) => {
            if (id === e.target.id) {
                  styles = "level level_active"
            }

      }
      console.log(styles);


      const { children, id } = props
      return (
            <div>
                  <button onClick={(e) => callingElevator(e)} id={id} className={styles}>{children}</button>
            </div>
      );
}

